    [],nt"num_tags": 8,nt"name": "neal-smith-national-wildlife-refuge-fiscal-year-1999-annual-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This is the fiscal year 1999 annual narrative
    report for Neal Smith National Wildlife Refuge.  The report begins with information
    about monitoring and studies which include surveys and investigations.  Habitat
    restoration and habitat management projects are also covered; activities include
    planting, harvesting, propagation, Friendsu2019 Prairie, mowing, and fire management.
     Fish and wildlife management are discussed next.  Coordination activities are
    outlined, as well as resource protection.  Resource protection activities include
    law enforcement, permitting, and land acquisition.  Information about public education
    and recreation is given including education, school programs, and seminars.  Finally,
    refuge planning and administration are discussed.  Lists of refuge personnel and
    volunteer programs are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
